&lt;Questtext&gt;&lt;Title&gt;How to overcome heat&lt;/Title&gt;&lt;Mission1&gt;Conversation with Peppe&lt;/Mission1&gt;&lt;Mission2&gt;&lt;/Mission2&gt;&lt;Mission3&gt;&lt;/Mission3&gt;&lt;desc&gt;The heat of Lava Plateau was amazing. I was exhausted much faster than usual while hunting monsters. 

